    //    initRainbowMapping();
    //}

    //if (eRetExpiry != TFL_RESULT::TFL_OK)
    //    return eRetExpiry;	// Return latched error code.

    initRainbowMapping();

    double MaxMin = displayMax - displayMin;
   
    if (MaxMin == 0)
    {
        MaxMin = 1;
    }

    for (int i = 0; i < TFL_FRAME_SIZE; i++)
    {
        if (depthBuf[i] <= displayMin)
        {
            depthColor[i] = data_color_source[0];
            
            continue;
        }

        if (depthBuf[i] >= displayMax)
        {
            depthColor[i] = data_color_source[TFL_LENGTH_COLOR - 1];

            continue;
        }

        double value = double((depthBuf[i] - displayMin) / MaxMin);
        int location_array = int(value * TFL_LENGTH_COLOR);
        depthColor[i] = data_color_source[location_array];
    }
